const MovieModal = ({ toggleModalOpen, videoId, setVideoId }) => {
  return (
    <div className="videoplayer-container modal">
      <div class="modal-header">
        <span class="close-btn" onClick={toggleModalOpen}>
          &times;
        </span>
      </div>
      <div class="modal-content" id="player">
        <iframe
          title="vimeo-player"
          src="https://player.vimeo.com/video/101369254"
          width="640"
          height="360"
          frameborder="0"
          allowfullscreen
        ></iframe>
      </div>
    </div>
  );
};

export default MovieModal;
